import React,{ useEffect, useState } from "react";
// import { Link } from "react-router-dom";
import axios from 'axios';
import Ssssss from './demo.jsx';

function Form() {

    const [team,setTeam] = useState();

    useEffect(() => {
        document.title = 'ddd';

        async function dataget(){
            const dd = await axios.get('/api/team');
            setTeam(dd.data);
        }
        dataget();
    },[]);

    if (team) {
        return (
            <>
                <br/>
                <br/>
                <br/>
                <br/>
                <h1>don</h1>
                {/* <Ssssss stude={team} /> */}
            </>
        )
    }
    else{
        return (
            <>
                <br/>
                <br/>
                <br/>
                <br/>
                <h1>demo</h1>
                {/* <Ssssss stude={team} /> */}
            </>
        )
    }
}

export default Form
